import React, { Component } from "react";
import ReactTable from "react-table";
import "react-table/react-table.css";

export class Table extends Component {
  render() {
    const data = [
      {
        name: "Tanner Linsley",
        age: 26,
        friend: {
          name: "Jason Maurer",
          age: 23
        }
      }
    ];
    return (
      <div>
        <h2>Prueba react table</h2>
      </div>
    );
  }
}
